import "./profile.css";
import "./links.css";
import "./social.css";
import "./share.css";
import Footer from "./component/footer";
import "./footer.css";
import Home from "./pages/Home";
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";

function App() {
    return (
      <Router>
        <div className='App'>
          <Switch>
            <Home />
          </Switch>
          <Footer />
        </div>
      </Router>
    );
}

export default App;
